import { MonoTypeOperatorFunction, Observable, Subject } from 'rxjs';
import { map } from 'rxjs/operators';
import { BaseEvent, LockEvent } from './interfaces/event.interface';
import { createValueState } from './state/state';
import {
  entityProperty as _entityProperty,
  ID,
  log as _log,
  LOG_LEVEL,
  UID,
  withLog as _withLog
} from './utils/tool-kit.util';
import { HashMap } from './utils/types';

export type BaseEntityType = 'node' | 'link' | 'port' | 'point';

export class BaseEntity {
  protected _id: ID;

  protected destroyed$ = new Subject<void>();
  protected locked$ = createValueState(false, this.entityPipe('locked'));

  protected readonly _logPrefix: string;

  constructor(id?: ID, logPrefix = '') {
    this._id = id || UID();
    this._logPrefix = `${logPrefix}`;
  }

  get id(): ID {
    return this._id;
  }

  set id(id: ID) {
    this._id = id;
  }

  log(message: string, ...args: any): void {
    _log(`${this._logPrefix} ${message}: `, LOG_LEVEL.LOG, ...args);
  }

  withLog(message: string, ...args: any): any {
    return _withLog(`${this._logPrefix} ${message}: `, LOG_LEVEL.LOG, ...args);
  }

  entityPipe<T>(logMessage: string = ''): MonoTypeOperatorFunction<T> {
    return _entityProperty<T>(this.onEntityDestroy(), 0, `${this._logPrefix}: ${logMessage}`);
  }

  getLocked(): boolean {
    return this.locked$.value;
  }

  setLocked(locked: boolean = true) {
    this.locked$.set(locked).emit();
  }

  // eslint-disable-next-line
  doClone(lookupTable: HashMap<any> = {}, clone: any) {
    /*noop*/
  }

  clone(lookupTable: HashMap<any> = {}) {
    // try and use an existing clone first
    if (lookupTable[this.id]) {
      return lookupTable[this.id];
    }
    const clone = { ...this };
    clone.id = UID();
    // clone.clearListeners();
    lookupTable[this.id] = clone;

    this.doClone(lookupTable, clone);
    return clone;
  }

  serialize() {
    return {
      id: this.id,
      locked: this.getLocked()
    };
  }

  lockChanges(): Observable<LockEvent> {
    return this.locked$.select((locked) => new LockEvent(this, locked));
  }

  destroy() {
    this.log('entity destroyed');
    this.destroyed$.next();
    this.destroyed$.complete();
  }

  onEntityDestroy(): Observable<BaseEvent<BaseEntity>> {
    return this.destroyed$.pipe(map((opts) => new BaseEvent(this, opts)));
  }
}

import { BaseEntity } from '../base.entity';
import { ID, UID } from '../utils/tool-kit.util';

// region events
export class BaseEvent<T extends BaseEntity> {
  entity: T;
  entityId: ID;
  stopPropagation: () => any;
  firing: boolean;
  id: ID;
  propogate: boolean;

  constructor(entity: T, options?: any) {
    this.id = UID();
    this.entity = entity;
    this.entityId = entity.id;
    this.firing = true;
    this.stopPropagation = () => (this.firing = false);
    this.propogate = options ? options.propagate : null;
  }
}
export class LockEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
  locked: boolean;

  constructor(entity: T, locked = false) {
    super(entity);
    this.locked = locked;
  }
}
export class ParentChangeEvent<
  P extends BaseEntity = BaseEntity,
  T extends BaseEntity = BaseEntity
> extends BaseEvent<T> {
  parent: P;

  constructor(entity: T, parent: P) {
    super(entity);
    this.parent = parent;
  }
}
export class SelectionEvent<
  T extends BaseEntity = BaseEntity
> extends BaseEvent<T> {
  isSelected: boolean;

  constructor(entity: T, selected: boolean) {
    super(entity);
    this.isSelected = selected;
  }
}
export class PaintedEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<
  T
> {
  isPainted: boolean;

  constructor(entity: T, painted = false) {
    super(entity);
    this.isPainted = painted;
  }
}
// endregion

import { Observable } from 'rxjs';
import { BaseEntity } from '../base.entity';
import { PaintedEvent, ParentChangeEvent, SelectionEvent } from '../interfaces/event.interface';
import { createValueState } from '../state/state';

export class BaseModel<E extends BaseEntity = BaseEntity> extends BaseEntity {
  protected readonly _type: string;

  protected parent$ = createValueState<E>(null, this.entityPipe('ParentsChange'));
  protected selected$ = createValueState<boolean>(false, this.entityPipe('SelectedChange'));
  protected hovered$ = createValueState<boolean>(false, this.entityPipe('HoveredChange'));
  protected painted$ = createValueState<boolean>(false, this.entityPipe('PaintedChange'));

  constructor(type?: string, id?: string, logPrefix = '[Base]') {
    super(id, logPrefix);
    this._type = type;
  }

  serialize() {
    return {
      ...super.serialize(),
      type: this.getType()
    };
  }

  getParent(): E {
    return this.parent$.value;
  }

  setParent(parent: E): void {
    this.parent$.set(parent).emit();
  }

  parentChanges(): Observable<ParentChangeEvent<E>> {
    return this.parent$.select((p) => new ParentChangeEvent(this, p));
  }

  getPainted(): boolean {
    return this.painted$.value;
  }

  setPainted(painted: boolean = true): void {
    this.painted$.set(painted).emit();
  }

  getHovered(): boolean {
    return this.hovered$.value;
  }

  setHovered(painted: boolean = true): void {
    this.hovered$.set(painted).emit();
  }

  selectHovered(): Observable<boolean> {
    return this.hovered$.value$;
  }

  paintChanges(): Observable<PaintedEvent> {
    return this.painted$.select((p) => new PaintedEvent(this, p));
  }

  getType(): string {
    return this._type;
  }

  getSelected(): boolean {
    return this.selected$.value;
  }

  selectSelected(): Observable<boolean> {
    return this.selected$.select();
  }

  setSelected(selected: boolean = true): void {
    this.selected$.set(selected).emit();
  }

  selectionChanges(): Observable<SelectionEvent> {
    return this.selected$.select((selected) => new SelectionEvent(this, selected));
  }

  getSelectedEntities(): BaseModel[] {
    return this.getSelected() ? [this] : [];
  }
}

import {
  ViewContainerRef,
  ComponentRef,
  ComponentFactoryResolver,
  ComponentFactory,
  Renderer2,
} from '@angular/core';
import { AbstractLabelFactory, DefaultLabelModel } from 'ngx-diagrams';
import { CustomLabelComponent } from './custom-label.component';

export class CustomLabelFactory extends AbstractLabelFactory<
  DefaultLabelModel
> {
  constructor(
    private resolver: ComponentFactoryResolver,
    private renderer: Renderer2
  ) {
    super('custom-label');
  }

  generateWidget(
    label: CustomLabelComponent,
    labelHost: ViewContainerRef
  ): ComponentRef<CustomLabelComponent> {
    const componentRef = labelHost.createComponent(this.getRecipe());

    // attach coordinates and default positional behaviour to the generated component host
    const rootNode = componentRef.location.nativeElement;

    // default style for link
    this.renderer.setStyle(rootNode, 'position', 'absolute');

    // data attributes
    this.renderer.setAttribute(rootNode, 'data-labelid', label.id);

    // on destroy make sure to destroy the componentRef
    label.onEntityDestroy().subscribe(() => {
      componentRef.destroy();
    });

    // assign all passed properties to node initialization.
    Object.entries(label).forEach(([key, value]) => {
      componentRef.instance[key] = value;
    });

    return componentRef;
  }

  getRecipe(): ComponentFactory<CustomLabelComponent> {
    return this.resolver.resolveComponentFactory(CustomLabelComponent);
  }

  getNewInstance() {
    return new DefaultLabelModel();
  }
}

import {
  ViewContainerRef,
  ComponentRef,
  ComponentFactoryResolver,
  ComponentFactory,
  Renderer2,
} from '@angular/core';
import {
  AbstractLinkFactory,
  DefaultLinkModel,
  DiagramEngine,
} from 'ngx-diagrams';
import { CustomLinkComponent } from './custom-link.component';

export class CustomLinkFactory extends AbstractLinkFactory<DefaultLinkModel> {
  constructor(
    private resolver: ComponentFactoryResolver,
    private renderer: Renderer2
  ) {
    super('custom-link');
  }

  generateWidget(
    diagramEngine: DiagramEngine,
    link: DefaultLinkModel,
    linksHost: ViewContainerRef
  ): ComponentRef<CustomLinkComponent> {
    const componentRef = linksHost.createComponent(this.getRecipe());
    link.setWidth(1);
    link.setColor('pink');
    // attach coordinates and default positional behaviour to the generated component host
    const rootNode = componentRef.location.nativeElement;

    // default style for link
    this.renderer.setStyle(rootNode, 'position', 'absolute');

    // data attributes
    this.renderer.setAttribute(rootNode, 'data-linkid', link.id);

    // on destroy make sure to destroy the componentRef
    link.onEntityDestroy().subscribe(() => {
      componentRef.destroy();
    });

    // assign all passed properties to node initialization.
    Object.entries(link).forEach(([key, value]) => {
      componentRef.instance[key] = value;
    });

    componentRef.instance.diagramEngine = diagramEngine;
    componentRef.instance.setPainted(true);
    return componentRef;
  }

  getRecipe(): ComponentFactory<CustomLinkComponent> {
    return this.resolver.resolveComponentFactory(CustomLinkComponent);
  }

  getNewInstance() {
    return new DefaultLinkModel({ type: 'custom-link' });
  }
}

import {
  ComponentFactoryResolver,
  ViewContainerRef,
  ComponentRef,
  ComponentFactory,
  Renderer2,
} from '@angular/core';
import {
  AbstractNodeFactory,
  DefaultNodeModel,
  DiagramEngine,
} from 'ngx-diagrams';
import { CustomNodeComponent } from './custom.component';

export class CustomNodeFactory extends AbstractNodeFactory<DefaultNodeModel> {
  constructor(
    private resolver: ComponentFactoryResolver,
    private renderer: Renderer2
  ) {
    super('custom-node');
  }

  generateWidget(
    diagramEngine: DiagramEngine,
    node: DefaultNodeModel,
    nodesHost: ViewContainerRef
  ): ComponentRef<CustomNodeComponent> {
    const componentRef = nodesHost.createComponent(this.getRecipe());

    // attach coordinates and default positional behaviour to the generated component host
    const rootNode = componentRef.location.nativeElement;

    // default style for node
    this.renderer.setStyle(rootNode, 'position', 'absolute');
    this.renderer.setStyle(rootNode, 'display', 'block');

    // data attributes
    this.renderer.setAttribute(rootNode, 'data-nodeid', node.id);

    // subscribe to node coordinates
    node.selectCoords().subscribe(({ x, y }) => {
      this.renderer.setStyle(rootNode, 'left', `${x}px`);
      this.renderer.setStyle(rootNode, 'top', `${y}px`);
    });

    node.selectionChanges().subscribe((e) => {
      e.isSelected
        ? this.renderer.addClass(rootNode, 'selected')
        : this.renderer.removeClass(rootNode, 'selected');
    });

    node.onEntityDestroy().subscribe((e) => {
      componentRef.destroy();
    });

    // assign all passed properties to node initialization.
    Object.entries(node).forEach(([key, value]) => {
      componentRef.instance[key] = value;
    });

    componentRef.instance.setDiagramEngine(diagramEngine);

    return componentRef;
  }

  getRecipe(): ComponentFactory<CustomNodeComponent> {
    return this.resolver.resolveComponentFactory(CustomNodeComponent);
  }

  getNewInstance(initialConfig?: any): DefaultNodeModel {
    return new DefaultNodeModel(...initialConfig);
  }
}

import {
  ViewContainerRef,
  ComponentRef,
  ComponentFactory,
  ComponentFactoryResolver,
  Renderer2,
} from '@angular/core';
import { AbstractPortFactory, DefaultPortModel } from 'ngx-diagrams';
import { Observable } from 'rxjs';
import { map, takeUntil } from 'rxjs/operators';
import { CustomPortComponent } from './custom.component';

export class CustomPortFactory extends AbstractPortFactory<
  CustomPortComponent
> {
  constructor(
    private resolver: ComponentFactoryResolver,
    private renderer: Renderer2
  ) {
    super('custom-port');
  }

  generateWidget(
    port: DefaultPortModel,
    portsHost: ViewContainerRef
  ): ComponentRef<CustomPortComponent> {
    const componentRef = portsHost.createComponent(this.getRecipe());

    // attach coordinates and default positional behaviour to the generated component host
    const rootNode = componentRef.location.nativeElement as HTMLElement;

    // data attributes
    this.renderer.setAttribute(rootNode, 'data-portid', port.id);
    this.renderer.setAttribute(rootNode, 'data-name', port.getName());

    port.in
      ? this.renderer.addClass(rootNode, 'in')
      : this.renderer.addClass(rootNode, 'out');

    // assign all passed properties to node initialization.
    Object.entries(port).forEach(([key, value]) => {
      componentRef.instance[key] = value;
    });

    // this method will add classes to all ports that have links
    this.isConnected(port).subscribe((connected) => {
      connected
        ? this.renderer.addClass(rootNode, 'connected')
        : this.renderer.removeClass(rootNode, 'connected');
    });

    port.onEntityDestroy().subscribe((e) => {
      componentRef.destroy();
    });

    return componentRef;
  }

  getRecipe(): ComponentFactory<CustomPortComponent> {
    return this.resolver.resolveComponentFactory(CustomPortComponent);
  }

  getNewInstance(initialConfig?: any): DefaultPortModel {
    return new DefaultPortModel({
      isInput: true,
      name: 'unknown',
      ...initialConfig,
    });
  }

