export class PointModel extends BaseModel<LinkModel> {
  protected coords$: ValueState<Coords>;

  constructor(link: LinkModel, coords: Coords, id?: string, logPrefix: string = '[Point]') {
    super(link.getType(), id, logPrefix);
    this.coords$ = createValueState(coords, this.entityPipe('coords'));
    this.setParent(link);
  }

  serialize(): SerializedPointModel {
    return {
      ...super.serialize(),
      coords: this.getCoords()
    };
  }

  isConnectedToPort() {
    return this.getParent().getPortForPoint(this) !== null;
  }

  getLink(): LinkModel {
    return this.getParent();
  }

  destroy() {
    if (this.getParent) {
      this.getParent().removePoint(this);
    }

    super.destroy();
  }

  setCoords(newCoords: Partial<Coords>) {
    this.coords$.set({ ...this.getCoords(), ...newCoords }).emit();
  }

  selectCoords(): Observable<Coords> {
    return this.coords$.value$;
  }

  getCoords(): Coords {
    return this.coords$.value;
  }

  selectX(): Observable<number> {
    return this.coords$.select((coords) => coords.x);
  }

  selectY(): Observable<number> {
    return this.coords$.select((coords) => coords.y);
  }
}

import { Observable } from 'rxjs';
import { createEntityState, createValueState } from '../state/state';
import { EntityMap, ID, isString } from '../utils';
import { BaseModel } from './base.model';
import { LinkModel } from './link.model';
import { NodeModel } from './node.model';

export class PortModel extends BaseModel<NodeModel> {
  // TODO: convert all primitives to subjects
  protected name: string;
  protected maximumLinks: number;
  protected linkType: string;

  protected links$ = createEntityState<LinkModel>([], this.entityPipe('links'));
  protected x$ = createValueState(0, this.entityPipe('x'));
  protected y$ = createValueState(0, this.entityPipe('y'));
  protected width$ = createValueState(0, this.entityPipe('y'));
  protected height$ = createValueState(0, this.entityPipe('y'));
  protected magnetic$ = createValueState(true, this.entityPipe('magnetic'));
  protected canCreateLinks$ = createValueState(true, this.entityPipe('magnetic'));

  constructor(
    name: string,
    type?: string,
    id?: string,
    maximumLinks?: number,
    linkType?: string,
    magnetic: boolean = true,
    logPrefix: string = '[Port]'
  ) {
    super(type, id, logPrefix);
    this.name = name;
    this.maximumLinks = maximumLinks;
    this.linkType = linkType;
    this.setMagnetic(magnetic);
  }

  serialize() {
    return {
      ...super.serialize(),
      name: this.getName(),
      linkType: this.getLinkType(),
      maximumLinks: this.getMaximumLinks(),
      type: this.getType(),
      magnetic: this.getMagnetic(),
      height: this.getHeight(),
      width: this.getWidth(),
      canCreateLinks: this.getCanCreateLinks(),
      ...this.getCoords()
    };
  }

  getNode() {
    return this.getParent();
  }

  getName() {
    return this.name;
  }

  getCanCreateLinks(): boolean {
    const numberOfLinks = this.getLinks().size;

    if (this.maximumLinks && numberOfLinks >= this.maximumLinks) {
      return false;
    }

    return this.canCreateLinks$.value;
  }

  getCoords() {
    return { x: this.getX(), y: this.getY() };
  }

  selectCanCreateLinks(): Observable<boolean> {
    return this.canCreateLinks$.value$;
  }

  setCanCreateLinks(value: boolean) {
    this.canCreateLinks$.set(value).emit();
  }

  getMagnetic(): boolean {
    return this.magnetic$.value;
  }

  selectMagnetic(): Observable<boolean> {
    return this.magnetic$.value$;
  }

  setMagnetic(magnetic: boolean) {
    this.magnetic$.set(magnetic).emit();
  }

  selectX(): Observable<number> {
    return this.x$.value$;
  }

  selectY(): Observable<number> {
    return this.y$.value$;
  }

  getY() {
    return this.y$.value;
  }

  getX() {
    return this.x$.value;
  }

  getHeight() {
    return this.height$.value;
  }

  getWidth() {
    return this.width$.value;
  }

  getMaximumLinks(): number {
    return this.maximumLinks;
  }

  setMaximumLinks(maximumLinks: number) {
    this.maximumLinks = maximumLinks;
  }

  getLinkType() {
    return this.linkType;
  }

  setLinkType(type: string) {
    this.linkType = type;
  }

  removeLink(linkOrId: ID | LinkModel) {
    const linkId = isString(linkOrId) ? linkOrId : linkOrId.id;
    this.links$.remove(linkId, false).emit();
  }

  addLink(link: LinkModel) {
    this.links$.add(link).emit();
  }

  getLinks(): EntityMap<LinkModel> {
    return this.links$.value;
  }

  getLinksArray(): LinkModel[] {
    return this.links$.array();
  }

  selectLinks(): Observable<EntityMap<LinkModel>> {
    return this.links$.value$;
  }

  updateCoords({ x, y, width, height }: { x: number; y: number; width: number; height: number }) {
    this.x$.set(x).emit();
    this.y$.set(y).emit();
    this.width$.set(width).emit();
    this.height$.set(height).emit();
  }

  canLinkToPort(port: PortModel): boolean {
    return true;
  }

  isLocked() {
    return super.getLocked();
  }

  createLinkModel() {
    if (this.getCanCreateLinks()) {
      return new LinkModel();
    }
  }

  destroy() {
    super.destroy();
    this.links$.clear().emit();
  }
}

import { BaseAction } from './base.action';
import { DiagramModel } from '../models/diagram.model';
import { Coords } from '../interfaces/coords.interface';

export class SelectingAction extends BaseAction {
  mouseX2: number;
  mouseY2: number;

  dimensions: {
    top: number;
    left: number;
    width: number;
    height: number;
    right: number;
    bottom: number;
  };

  constructor(mouseX: number, mouseY: number) {
    super(mouseX, mouseY);
    this.mouseX2 = mouseX;
    this.mouseY2 = mouseY;
  }

  getBoxDimensions() {
    this.dimensions = {
      left: this.mouseX2 > this.mouseX ? this.mouseX : this.mouseX2,
      top: this.mouseY2 > this.mouseY ? this.mouseY : this.mouseY2,
      width: Math.abs(this.mouseX2 - this.mouseX),
      height: Math.abs(this.mouseY2 - this.mouseY),
      right: this.mouseX2 < this.mouseX ? this.mouseX : this.mouseX2,
      bottom: this.mouseY2 < this.mouseY ? this.mouseY : this.mouseY2,
    };
    return this.dimensions;
  }

  containsElement({ x, y }: Coords, diagramModel: DiagramModel): boolean {
    const z = diagramModel.getZoomLevel() / 100.0;
    const dimensions = this.getBoxDimensions();

    return (
      x * z + diagramModel.getOffsetX() > dimensions.left &&
      x * z + diagramModel.getOffsetX() < dimensions.right &&
      y * z + diagramModel.getOffsetY() > dimensions.top &&
      y * z + diagramModel.getOffsetY() < dimensions.bottom
    );
  }
}

import { BaseEntity } from '../base.entity';
import { ID, UID } from '../utils/tool-kit.util';

// region events
export class BaseEvent<T extends BaseEntity> {
  entity: T;
  entityId: ID;
  stopPropagation: () => any;
  firing: boolean;
  id: ID;
  propogate: boolean;

  constructor(entity: T, options?: any) {
    this.id = UID();
    this.entity = entity;
    this.entityId = entity.id;
    this.firing = true;
    this.stopPropagation = () => (this.firing = false);
    this.propogate = options ? options.propagate : null;
  }
}
export class LockEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
  locked: boolean;

  constructor(entity: T, locked = false) {
    super(entity);
    this.locked = locked;
  }
}
export class ParentChangeEvent<
  P extends BaseEntity = BaseEntity,
  T extends BaseEntity = BaseEntity
> extends BaseEvent<T> {
  parent: P;

  constructor(entity: T, parent: P) {
    super(entity);
    this.parent = parent;
